svg.script:
 function Highlight2(evt, x1, y1, x2, y2) {
 var doc;
 doc = evt.target.ownerDocument;
 doc.getElementById("hLine").setAttribute("x1", x1);
 doc.getElementById("hLine").setAttribute("y1", y1);
 doc.getElementById("hLine").setAttribute("x2", x2);
 doc.getElementById("hLine").setAttribute("y2", y2);
}
